import React, { useRef, useEffect } from "react";
import { motion, useScroll, useTransform, useSpring, useInView } from "framer-motion";
import Header from "./Header";
import InteractiveLines from "./InteractiveLines-i";
import Footer from "./Footer";

const Infosafe: React.FC = () => {
  const { scrollY } = useScroll();
  const scrollX = useTransform(scrollY, [0, 400], [0, -200]);
  const xSpring = useSpring(scrollX, { stiffness: 100, damping: 30 });
  const heroRef = useRef(null);
  const heroInView = useInView(heroRef, { once: true, amount: 0.3 });

  useEffect(() => {
    console.log('Infosafe component mounted');
    console.log('Hero in view:', heroInView);
  }, [heroInView]);

  return (
    <div className="relative min-h-screen bg-[#F4F1EC]">
      <Header />
      <motion.section 
        ref={heroRef}
        className="relative w-full min-h-[100vh] h-screen overflow-hidden"
        initial={{ opacity: 0 }}
        animate={{ opacity: heroInView ? 1 : 0 }}
        transition={{ duration: 1 }}
      >
        <InteractiveLines />
        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-20 translate-y-50"
            animate={{
              y: [0, -20, 0],
              scale: [1, 1.1, 1],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <motion.img 
              src="/card2.png" 
              alt="Infosafe" 
              className="w-80 h-auto"
              whileHover={{
                scale: 1.1,
                transition: {
                  duration: 0.3,
                  ease: "easeOut"
                }
              }}
              onError={(e) => {
                console.error('Error loading image:', e);
                e.currentTarget.src = '/placeholder.png';
              }}
            />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-right mt-[45vh] md:mt-[25vh] pr-[5vw] whitespace-nowrap"
          style={{ x: xSpring }}
        >
          INFOSAFE
        </motion.h1>
      </motion.section>
      
      {/* About and Login Portal Section */}
      <section className="w-full min-h-screen bg-[#F4F1EC] py-20 px-4 md:px-8 lg:px-16">
        <div className="max-w-7xl mx-auto grid grid-cols-1 md:grid-cols-2 gap-12">
          {/* About Section */}
          <div className="space-y-8">
            <h2 className="text-5xl font-bold font-serif">About</h2>
            <p className="text-lg text-gray-700">
              A real-time platform for reporting and sharing incidents, enabling users to
              document emergencies or concerns and enhance community safety.
            </p>
            <div className="bg-yellow-400 p-6 rounded-lg">
              <p className="font-medium">
                Goal: Enhance community safety awareness and responsiveness.
              </p>
            </div>
            <div className="mt-8">
              <img
                src="/city-night.jpg"
                alt="IN4SAFE"
                className="w-full rounded-lg shadow-lg"
              />
            </div>
          </div>

          {/* Login Portal Section */}
          <div className="bg-black rounded-lg p-8 text-white">
            <div className="flex justify-between items-center mb-8">
              <h3 className="text-yellow-400 text-2xl font-bold">IN4SAFE</h3>
              <div className="flex items-center space-x-4">
                <button className="text-white hover:text-yellow-400">Profile</button>
                <div className="relative">
                  <input
                    type="search"
                    placeholder="Search"
                    className="bg-gray-800 rounded px-3 py-1 text-sm"
                  />
                </div>
              </div>
            </div>

            <div className="text-center space-y-8">
              <h1 className="text-4xl text-yellow-400 font-bold">
                Welcome to Our<br />Community Safety Portal
              </h1>
              <p className="text-gray-300">Check and share nearby incident alerts at any time.</p>

              <div className="space-y-4 max-w-md mx-auto">
                <input
                  type="text"
                  className="w-full bg-gray-800 rounded p-3"
                  placeholder="Username"
                />
                <input
                  type="password"
                  className="w-full bg-gray-800 rounded p-3"
                  placeholder="Password"
                />
                <div className="flex justify-between items-center">
                  <a href="#" className="text-sm text-gray-300 hover:text-yellow-400">
                    Forgot Password
                  </a>
                  <button className="bg-yellow-400 text-black px-8 py-2 rounded font-medium hover:bg-yellow-500">
                    Login
                  </button>
                </div>
                <div className="space-y-3 mt-4">
                  <button className="w-full border border-gray-600 rounded p-2 flex items-center justify-center space-x-2 hover:bg-gray-800">
                    <img src="/google-icon.png" alt="Google" className="w-5 h-5" />
                    <span>Login with Google</span>
                  </button>
                  <button className="w-full border border-gray-600 rounded p-2 hover:bg-gray-800">
                    Login with In4out
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <Footer />
    </div>
  );
};

export default Infosafe;
